import React from "react";
import { BrowserRouter, Route, Routes, useNavigate } from "react-router-dom";
import MainPage from "./MainPage";
import Navbar from "./Navbar";
import StudentList from './StudentList'
import Certificate from "./Certificate";

function App() {
  const data = {year:null, branch:null, heldin:null}
  let resultData=null;
  const setdata = (data) => {
    resultData = data;
  }
  // <Route path='/results/certificate' element={<Certificate result={resultData}/>} />
  return(
    <React.Fragment>
      <Navbar/>
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<MainPage onSucc={data}/>} />
        <Route path='/results' element={<StudentList data={data} senddata={setdata}/>} />
        <Route path='/results/certificate' element={<h1>{resultData}</h1>} />
       </Routes>


    </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
